import React from 'react';
import { GlobalStyles } from './global';
import { Cover } from './components';

import { ThemeProvider } from 'styled-components';
import './App.css';
import { theme } from './theme';

function App() {
  return (

<ThemeProvider  theme={theme}>
  <> 

  <GlobalStyles />

  <section className="landing" >

        <Cover />


    </section>

  </>
</ThemeProvider>

  );
}

export default App;
